import {mat4} from 'gl-matrix'

import * as input from './input'
import * as shaders from './shaders'
import * as state from './state'
import * as transforms from './transforms'
import {Camera, ProgramInfo, Shape} from './types'

// WebGl reference:
// https://developer.mozilla.org/en-US/docs/Web/API/WebGL_API/Tutorial/Adding_2D_content_to_a_WebGL_context

function initShaderProgram(gl: WebGLRenderingContext, vsSource: string, fsSource: string) {
    // Initialize a shader program, so WebGL knows how to draw our data
    const vertexShader = loadShader(gl, gl.VERTEX_SHADER, vsSource)
    const fragmentShader = loadShader(gl, gl.FRAGMENT_SHADER, fsSource)

    // Create the shader program
    const shaderProgram = gl.createProgram()
    gl.attachShader(shaderProgram, vertexShader)
    gl.attachShader(shaderProgram, fragmentShader)
    gl.linkProgram(shaderProgram)

    // If creating the shader program failed, alert
    if (!gl.getProgramParameter(shaderProgram, gl.LINK_STATUS)) {
        alert('Unable to initialize the shader program: ' + gl.getProgramInfoLog(shaderProgram))
        return null
    }

    return shaderProgram
}

function loadShader(gl: WebGLRenderingContext, type: number, source: string) {
    // creates a shader of the given type, uploads the source and
    // compiles it.
    const shader = gl.createShader(type)

    // Send the source to the shader object
    gl.shaderSource(shader, source)

    // Compile the shader program
    gl.compileShader(shader)

    // See if it compiled successfully
    if (!gl.getShaderParameter(shader, gl.COMPILE_STATUS)) {
        alert('An error occurred compiling the shaders: ' + gl.getShaderInfoLog(shader))
        gl.deleteShader(shader)
        return null
    }

    return shader
}

function drawScene(
    gl: WebGLRenderingContext,
    programInfo: ProgramInfo,
    staticBuffers: any,
    pfBuffers: any,
    skyboxPositBuffer: any,
    viewMatrix: Float32Array,
    projectionMatrix: Float32Array,
    shapes: Map<number, Shape>,
) {

    // Clear the canvas before we start drawing on it.
    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT)

    // Skybox
    // {
    //     // We'll supply texcoords as floats.
    //     gl.vertexAttribPointer(
    //         programInfo.attribLocations.skyboxTexCoords,
    //         2,
    //         gl.FLOAT,
    //         false,
    //         0,
    //         0
    //     )
    //     gl.enableVertexAttribArray(programInfo.attribLocations.skyboxTexCoords)
    // }

    shapes.forEach(
        (shape, s_id, map_) => {
            // Create a perspective matrix, a special matrix that is
            // used to simulate the distortion of perspective in a camera.
            // Our field of view is 45 degrees, with a width/height
            // ratio that matches the display size of the canvas
            // and we only want to see objects between 0.1 units
            // and 100 units away from the camera.

            // Set the drawing position to the "identity" point, which is
            // the center of the scene.

            // We've positioned our points rel to their model and the cam already,
            // using 4d transforms; doesn't modify further.

            // Tell WebGL how to pull out the positions from the position
            // buffer into the vertexPosition attribute.
            {
                const numComponents = 4  // pull out 4 values per iteration
                const type = gl.FLOAT    // the data in the buffer is 32bit floats
                const normalize = false  // don't normalize
                const stride = 0         // how many bytes to get from one set of values to the next
                                         // 0 = use type and numComponents above
                const offset = 0         // how many bytes inside the buffer to start from

                gl.bindBuffer(gl.ARRAY_BUFFER, staticBuffers.vertexBuffers.get(s_id))
                gl.vertexAttribPointer(
                    programInfo.attribLocations.vertexPosition,
                    numComponents,
                    type,
                    normalize,
                    stride,
                    offset)
                gl.enableVertexAttribArray(programInfo.attribLocations.vertexPosition)
            }

            gl.bindBuffer(gl.ARRAY_BUFFER, staticBuffers.normalBuffers.get(s_id))
            gl.vertexAttribPointer(
                programInfo.attribLocations.normal,
                4,
                gl.FLOAT,
                false,
                0,
                0
            )
            gl.enableVertexAttribArray(programInfo.attribLocations.normal)

            // Tell WebGL how to pull out the colors from the color buffer
            // into the vertexColor attribute.

            // Tell WebGL which indices to use to index the vertices
            gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, staticBuffers.indexBuffers.get(s_id))

            // Tell WebGL to use our program when drawing
            gl.useProgram(programInfo.program)

            // Set the shader uniforms
            gl.uniformMatrix4fv(
                programInfo.uniformLocations.projectionMatrix,
                false,  // transponse is always false for WebGl.
                projectionMatrix
            )

            gl.uniformMatrix4fv(
                programInfo.uniformLocations.modelMatrix,
                false,
                transforms.makeModelMat4(shape)
            )
            gl.uniformMatrix4fv(
                programInfo.uniformLocations.viewMatrix,
                false,
                viewMatrix
            )
            gl.uniform1f(programInfo.uniformLocations.colorMax, state.colorMax)
            gl.uniform1f(programInfo.uniformLocations.ambientIntensity, state.lighting.ambientIntensity)
            gl.uniform1f(programInfo.uniformLocations.specularIntensity, state.lighting.specularIntensity)

            gl.uniform4fv(programInfo.uniformLocations.shapePosition,
                new Float32Array(shape.position))
            gl.uniform4fv(programInfo.uniformLocations.camPosition,
                new Float32Array(state.cam.position))
            gl.uniform4fv(programInfo.uniformLocations.ambientLightColor,
                state.lighting.ambientColor)
            gl.uniform4fv(programInfo.uniformLocations.diffuseLightColor,
                state.lighting.diffuseColor)
            gl.uniform4fv(programInfo.uniformLocations.diffuseLightDirection,
                state.lighting.diffuseDirection)

            {
                const type = gl.UNSIGNED_SHORT
                const offset = 0
                const vertexCount = shape.tris.length

                gl.drawElements(gl.TRIANGLES, vertexCount, type, offset)
            }
        }
    )
}

